import React,{useState} from 'react'
// import './Update.css'
import Axior from 'axios'

function Update() {

    const[db,setDb] = useState(null);

    const getJoke = () => {
        Axios.get("http://localhost:5000/db").then(
            (response) => {
                console.log(response.data);
                setDb(response.data);
            }
        )
    }

  return (
      <>
    <div className='title'>Update</div>
      </>
  )
}

export default Update
